import React from 'react';
import {
    BrowserRouter as Router,
    Route, Redirect
} from 'react-router-dom';
import NavBar from '../Navigation';
import Landing from '../Landing'; 
import SignUpPage from '../SignUp';
// import SignUpWithEmail from '../SignUp/SignUpWithEmail/SUemail'; 
import ContractorActiveJobsPage from '../ContractorActiveJobsPage'; 
import SignIn from '../Login';
import MyProfile from '../MyProfile';
import MyProfileClient from '../MyProfileClient';
import PostingPage from '../PostingPage';
import InboxPage from '../Inbox';
import * as ROUTES from '../../constants/routes';
import NewMap from '../Maps';
import ContractorExplorePage from '../ContractorExplorePage'; 
import HomeOwnerExplorePage from '../HomeOwnerExplorePage'; 
import Review from '../Review';
import AListing from '../AddListing';
import SearchResults from '../SearchResults';
import homeowneractivejobs from '../HomeOwnerActiveJobsPage';
import Cprofile from "../ProfileView";
import ClientProfile from "../ProfileViewClient";
import ActivePosting from "../PostingPage_Active";
import CompletedPosting from "../PostingPage_Completed";
import UnassignedPosting from "../PostingPage_Unassigned";
import PendingPosting from "../PostingPage_Pending";
import About from "../AboutUs";
import Footer from '../Footer';
import Invoice from "../Invoice";

//floating button and report form for alfa testing
import Report from '@material-ui/icons/ReportProblem';
import Popup from "reactjs-popup";
import ReportForm from '../ReportForm';

const contentStyle = {
    width: '702px',
    height: 'auto',
    background: '#FFFFFF',
    borderRadius: '16px',
};
//report form components ends

const App = () => {
    return  (    
        <React.Fragment>
            <Router>      
                <NavBar />
                {/*Report Pop up view*/}
                <Popup trigger={
                    <Report style={{position:'fixed', right:'40', bottom:'40px', 
                    zIndex:"1000", borderRadius:'50%', padding:'10px',
                    background:'#2B64D2', color:'orange', cursor:'pointer'}}/>
                    } 
                    modal contentStyle={contentStyle}>
                    {close => <ReportForm close={close} />}
                </Popup>   
                {/*Report popup ends */}

                {localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Contractor' 
                ?<Route path={ROUTES.LANDING} component={ContractorExplorePage}/>
                : localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Client'
                ?<Route path={ROUTES.LANDING} component={HomeOwnerExplorePage}/>
                :<Route path={ROUTES.LANDING} component={Landing} />
                }
                {localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Contractor' 
                ?<Route path={ROUTES.POSTING} component={PostingPage} />
                : localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Client'
                ?<Route path={ROUTES.UNASSIGNEDPOSTING} component={UnassignedPosting}/>
                :null
                }
                {localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Contractor' 
                ?<Route path={ROUTES.MY_PROFILE} component={MyProfile} />
                : localStorage.getItem('access-token') && localStorage.getItem('usertype') === 'Client'
                ?<Route path={ROUTES.MY_PROFILE} component={MyProfileClient} />
                :null
                }
                <Route path={ROUTES.SIGN_UP} component={SignUpPage} />
                <Route path={ROUTES.ABOUT} component={About} />
                <Route path={ROUTES.LOGIN} component={SignIn} />
                <Route path={ROUTES.CONTRACTOR_ACTIVE_JOBS} component={ContractorActiveJobsPage} />
                <Route path={ROUTES.CONTRACTOR_EXPLORE} component={ContractorExplorePage} /> 
                <Route path={ROUTES.HOMEOWNER_EXPLORE} component={HomeOwnerExplorePage} /> 
                <Route path={ROUTES.INBOX} component={InboxPage} />            
                <Route path={ROUTES.REVIEW} component={Review}/>

                <Route path={ROUTES.ACTIVEPOSTING} component={ActivePosting} />
                <Route path={ROUTES.COMPLETEDPOSTING} component={CompletedPosting} />

                <Route path={ROUTES.PENDINGPOSTING} component={PendingPosting} />
                <Route path={ROUTES.PROFILE} component={Cprofile} />  
                <Route path={ROUTES.CLIENTPROFILE} component={ClientProfile} />           
                <Route path={ROUTES.MAPS} component={NewMap} />  
                <Route path={ROUTES.ADDLISTING} component={AListing}/> 
                <Route path={ROUTES.SEARCHRESULTS} component={SearchResults}/> 
                <Route path={ROUTES.HOMEOWNER_ACTIVE_JOBS} component={homeowneractivejobs}/> 
                <Route path={ROUTES.INVOICE} component={Invoice}/>
                <Route exact path="/">
                    <Redirect to="/Landing" />
                </Route>
                <Route exact path="/ContractorActiveJobs">
                    <Redirect to="/ContractorActiveJobs/active" />
                </Route>
                <Route exact path="/homeowneractivejobs">
                    <Redirect to="/homeowneractivejobs/active" />
                </Route>
                <Route
                    exact
                    path="/InboxPage/:receiverName/:receiverId"
                    render={({ match }) => (
                        <Redirect to={{
                            pathname: "/InboxPage",
                            state: { receiverName: match.params.receiverName, receiverId:match.params.receiverId, from:'notification'}
                        }}/>
                    )}
                />

{!localStorage.getItem('access-token') ? <Footer/>: null}
            </Router>
        </React.Fragment>
    )
};

export default App;
